import { useEffect } from "react"

function login(props){
    userid=props.userid
    password=props.password
    console.log('http://127.0.0.1:5000/api/login/'+{userid}+'/'+{password})
    useEffect(() => {
        fetch('http://127.0.0.1:5000/api/login/'+{userid}/{password})  // API endpoint of your Flask server
          .then(response => response.json())
          .then(data => {
            setData(data);
            data.map(item=>(
              console.log(item)
            ))
          })
          .catch(error => {
            console.error('Error:', error);
          });
      }, []);

}
